import * as React from 'react';
import { Card } from '@material-ui/core';



const Immagini = () => {
        return (
            <>  
            <Card style={{backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid",}} > Img 1
            </Card>
            <Card style={{backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid",}} > Img 2
            </Card>
            <Card style={{backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid",}} > Img 3
            </Card>
            <Card style={{backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid",}} > Img 4
            </Card>
            <Card style={{backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid",}} > Img 5
            </Card>
            <Card style={{backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid",}} > Img 6
            </Card>
            <Card style={{backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid",}} > Img 7
            </Card>
            <Card style={{backgroundColor:"grey", border: "5px", borderColor:"black", borderStyle:"solid",}} > Img 8
            </Card>
            </>
        );
}
 
export default Immagini;
